import logo from "./logo.svg";
import "./App.css";
import Header from "./Header";
import Footer from "./Footer";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import CreateNote from "./CreateNote";

function App() {
  return (
    <>
      <Header />
      <Footer />
      <CreateNote />
    </>
  );
}

export default App;
